import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App2 from './App';
import Header from './Header';
import Footer from './Footer';
//import App from './PyScr';
import reportWebVitals from './reportWebVitals';

const soundStrengthLab = ['Silence', 'Soft', 'Medium', 'Loud', 'Deafening'];
const soundStrengthDiv = 'StrengthofSounds';
const weatherSkyLab = ['Sunny', 'Partky Cloudy', 'Mostly Cloudy', 'Cloudy', 'Stormy'];
const weatherSkyDiv = 'SkyConditions';
const weatherTempLab = ['Hot', 'Warm', 'Cool', 'Crisp', 'Cold'];
const weatherTempDiv = 'Temperature';

const { spawn } = require('child_process');

const python = spawn('python', ['test.py'])

//python.stdout.on('data', function (data) {
//})

//python.on('close', (code) => {

//})

ReactDOM.render(
  <React.StrictMode>
    <Header />
    <p>Weather:</p>
    <p>Sky Conditions</p>
    <App2 lab={weatherSkyLab} div={weatherSkyDiv} />
    <p>Temperature</p>
    <App2 lab={weatherTempLab} div={weatherTempDiv} />
    <p>Sensory Experience:</p>
    <p>When you recall your moment are there sounds you associate with it?</p>
    <p>Strength of Sounds</p>
    <App2 lab={soundStrengthLab} div={soundStrengthDiv} />

    <Footer />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
